const deployContract = async (api: ApiPromise, abi: string) => {
  const contractWasm = "";
  const contract = new CodePromise(api, abi, contractWasm);

  const gasLimit = 100000n * 1000000n
  const storageDepositLimit = null

  const tokenSupply = 1000;
  const tokenName = 0;
  const tokenSymbol = 0;
  const tokenDecimal = 1;

  const keyring = new Keyring({ type: 'sr25519' });
  const alice = keyring.addFromUri('//Alice');
  const tx = contract.tx.new({ gasLimit: gasLimit, storageDepositLimit: storageDepositLimit }, tokenName,
    tokenSupply,
    tokenSymbol,
    tokenDecimal);

  let address;

  const unsub = await tx.signAndSend(
    alice,
    // @ts-ignore
    ({ contract, status,  dispatchError }) => {
      new Promise((resolve) => setTimeout(resolve, 10000));
      if(contract) {
        address = contract.address
        console.log(`In block, address is ${address}`);
        console.log(`contract is ${contract}`);
      }
      console.log(`status is ${status}`);
      if (status.isInBlock || status.isFinalized) {
        console.log(`In block`);
        address = contract.address.toString();
        unsub();
      }

      if(dispatchError) {
        console.log(`error occurred ${dispatchError}`);
      }

      //console.log(`In block, address is ${address}`);
    }
  );
};
